import React, { Component } from 'react'


class Accueil extends Component {
  render() {
    return (
      <div className="">
        <div class="card card-image" id="header">
          <div class="text-white text-center rgba-stylish-strong py-5 px-4">
            <div class="py-5">
              <h4 class="h5 orange-text"><i class="fas fa-camera-retro"></i> E-COM</h4>
              <h2 class="card-title h2 my-4 py-2">Bienvenue to E-COM</h2>
              <p class="mb-4 pb-2 px-md-5 mx-md-5">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Pariatur obcaecati vero aliquid libero doloribus ad, unde tempora maiores</p>
              <a class="btn peach-gradient"><i class="fas fa-clone left"></i>Voir les produits</a>

            </div>
          </div>
        </div>

      </div>
    )
  }
}
export default Accueil;
